import {Typography, Button, Paper, IconButton, TextField,Container} from '@material-ui/core';
import AddShoppingCartIcon from "@material-ui/icons/AddShoppingCart";


function Navbar() {

 return (
   <div>
  <Button
   variant = "contained"
   color= "primary"
   align= "center"
  >
  Welcome to MovieSeed
  </Button>

  <IconButton color="primary" aria-label="add to shopping cart">
    <AddShoppingCartIcon />
  </IconButton>
  </div>
 );
}

export default Navbar;
